let events = dynamic(["EngageShareCreateDocument"]);
let mainTable = union pageViews, customEvents, requests
    | where timestamp > ago(14d)
    | where isempty(operation_SyntheticSource)
    | extend name =replace("\n", "", name)
    | where '*' in (events) or name in (events)
    | where true;
let queryTable = mainTable;
let splitTable = () {
    queryTable
    | extend dimension = customDimensions["EntryPoint"]
    | extend dimension = iif(isempty(dimension), "<undefined>", dimension)
};
let cohortedTable = splitTable
    | summarize events_Counts = count() by bin(timestamp, 1d), dimension;
let topSegments = cohortedTable
    | summarize sumDimension = sum(events_Counts) by dimension
    | project dimension, sumDimension
    | top 5 by sumDimension desc nulls last
    | summarize makelist(dimension);
cohortedTable
| extend dimension = iff(dimension in (topSegments), dimension, "Other")
| render barchart

// Exceptions causing request failures 
// Find which exceptions led to failed requests in the past hour. 
let systemName = "library-management";
let since = ago(7d);
requests
| where timestamp > since
| where customDimensions.KubernetesNamespace == systemName
| where success == false
| join kind= inner (exceptions) on operation_Id
| project exceptionType = type, failedMethod = method, requestName = name, operation_Id, timestamp
| summarize ExampleOperationId=max(operation_Id),LastOcurrence=max(timestamp), count() by exceptionType, failedMethod, requestName
| order by count_
